             INSERT INTO `fi_over_all_interpretations` (`id`, `category_ids`, `individual_range_ids`, `overall_range`, `interpretation`, `status`, `created_at`, `updated_at`) VALUES
(1, '1,2,3',    '1,1,1',    '1',    '[\"Architect lonely at the top, and being one of the rarest and most strategically capable personality types.\",\"Architect form just two percent of the population, and women of this personality type are especially rare, forming just 0.8% of the population.\",\"Architect enjoy sharing what they know as well, confident in their mastery of their chosen subjects.\",\"Architect at times it will seem that architect are bent on deconstructing and rebuilding every idea and system they come into contact with, employing a sense of perfectionism and even morality to this work.\"]', '1',    '2019-02-06 12:22:53',  '2019-02-07 12:45:48'),
(2, '1,2,3',    '6,3,3',    '4',    '[\"Logician personality type is fairly rare, making up only three percent of the population, which is definitely a good thing for them\",\"Logician are known for their brilliant theories and unrelenting logic  in fact, they are considered the most logically precise of all the personality types\",\"Logician may appear to drift about in an unending daydream, but INTPs thought process is unceasing, and their minds buzz with ideas from the moment they wake up\",\"Logician personalities are so prone to reassessing their own thoughts and theories, worrying that theyve missed some critical piece of the puzzle, that they can stagnate, lost in an intangible world where their thoughts are never truly applied\"]',    '1',    '2019-02-06 12:53:54',  '2019-02-07 12:57:39'),
(3, '1,2,3',    '3,6,3',    '4',    '[\"Commander with this personality type embody the gifts of charisma and confidence, and project authority in a way that draws crowds together behind a common goal.\",\"Commander emotional expression isn\\u2019t the strong suit of any Analyst type, but because of their Extraverted (E) nature, commander distance from their emotions is especially public, and felt directly by a much broader swath of people\",\"Commander need to remember though, that their stature comes not just from their own actions, but from the actions of the team that props them up, and that it\\u2019s important to recognize the contributions\",\"Commander will be rewarded with deep, satisfying relationships and all the challenging victories they can handle\"]',    '1',    '2019-02-06 12:54:43',  '2019-02-07 13:04:58'),
(4, '1,2,3',    '1,1,4',    '2',    '[\"Debater personality type is the ultimate devils advocate, thriving on the process of shredding arguments and beliefs and letting the ribbons drift in the wind for all to see\",\"Debater capacity for debate can be a vexing one  while often appreciated when its called for, it can fall painfully flat when they step on others toes by say, openly questioning their boss in a meeting, or picking apart everything their significant other says\",\"Debater intellectual independence and free-form vision are tremendously valuable when theyre in charge, or at least have the ear of someone\",\"Debater people with this personality type may find that the most complex and rewarding intellectual challenge is to understand a more sentimental perspective, and to argue consideration and compromise alongside logic and progress\"]',   '1',    '2019-02-06 13:28:49',  '2019-02-07 13:08:32'),
(5, '1,2,3',    '1,2,3',    '2',    '[\"Mediator personalities are true idealists, always looking for the hint of good in even the worst of people and events, searching for ways to make things better\",\"Mediator comprising just 4% of the population, the risk of feeling misunderstood is unfortunately high for the INFP personality type  but when they find like-minded people to spend their time with, the harmony they feel will be a fountain of joy and inspiration\",\"Mediator qualities enable INFPs to communicate deeply with others, easily speaking in metaphors and parables, and understanding and creating symbols to share their ideas\",\"Mediator strength of this intuitive communication style lends itself well to creative works, and it comes as no surprise that many famous INFPs are poets, writers and actors\"]', '1',    '2019-02-06 13:30:34',  '2019-02-07 13:12:11'),
(6, '1,2,3',    '1,3,2',    '2',    '[\"Enterperneur personality types always have an impact on their immediate surroundings  the best way to spot them at a party is to look for the whirling eddy of people flitting about them as they move from group to group\",\"Enterperneur laughing and entertaining with a blunt and earthy humor, ESTP personalities love to be the center of attention\",\"Enterperneur is an audience member is asked to come on stage, ESTPs volunteer  or volunteer a shy friend\",\"Enterperneur leap before they look, fixing their mistakes as they go, rather than sitting idle, preparing contingencies and escape clauses\"]',   '1',    '2019-02-06 13:30:40',  '2019-02-07 13:15:00'),
(7, '1,2,3',    '1,4,1',    '2',    '[\"Adventurer personality types are true artists, but not necessarily in the typical sense where theyre out painting happy little trees. Often enough though, they are perfectly capable of this\",\"Adventurer enjoy upsetting traditional expectations with experiments in beauty and behavior  chances are, theyve expressed more than once the phrase \'Dont box me in!\'\",\"Adventurer live in a colorful, sensual world, inspired by connections with people and ideas\",\"Adventurer personalities take joy in reinterpreting these connections, reinventing and experimenting with both themselves and new perspectives\"]',  '1',    '2019-02-06 13:30:45',  '2019-02-07 13:18:17'),
(8, '1,2,3',    '2,1,3',    '2',    '[\"Entertrainer is to be found spontaneously breaking into song and dance, it is the Entertrainer personality type\",\"Entertrainer get caught up in the excitement of the moment, and want everyone else to feel that way, too\",\"Entertrainer enjoy the simplest things, and theres no greater joy for them than just having fun with a good group of friends\",\"Entertrainer  rely on luck or opportunity, or simply ask for help from their extensive circle of friends\"]',    '1',    '2019-02-06 13:30:50',  '2019-02-07 13:21:03'),
(9, '1,2,3',    '2,2,2',    '2',    '[\"Defender personality type is quite unique, as many of their qualities defy the definition of their individual traits\",\"Defender possessing the Feeling (F) trait, Defender have excellent analytical abilities; though Introverted (I), they have well-developed people skills and robust social relationships\",\"Defender are true altruists, meeting kindness with kindness-in-excess and engaging the work and people they believe in with enthusiasm and generosity\",\"Defender need to know when to say no and stand up for themselves if they are to maintain their confidence and enthusiasm\"]',    '1',    '2019-02-06 13:30:55',  '2019-02-07 13:23:49'),
(10,    '1,2,3',    '2,3,1',    '2',    '[\"Advocate personality type is very rare, making up less than one percent of the population, but they nonetheless leave their mark on the world\",\"Advocate have an inborn sense of idealism and morality, but what sets them apart is the accompanying Judging trait\",\"Advocate tend to see helping others as their purpose in life, but while people with this personality type can be found engaging rescue efforts and doing charity work, their real passion is to get to the heart of the issue so that people need not be rescued at all\",\"Advocate indeed share a unique combination of traits: though soft-spoken, they have very strong opinions and will fight tirelessly for an idea they believe in\",\"Advocate are decisive and strong-willed, but will rarely use that energy for personal gain  advocate will act with creativity, imagination, conviction and sensitivity not to create advantage, but to create balance\"]', '1',    '2019-02-06 13:31:00',  '2019-02-07 13:28:44'),
(11,    '1,2,3',    '3,1,2',    '2',    '[\"Consultant personality type are, for lack of a better word, popular  which makes sense, given that it is also a very common personality type, making up twelve percent of the population\",\"Consultant are the cheerleaders and the quarterbacks, setting the tone, taking the spotlight and leading their teams forward to victory and fame\",\"Consultant continue to enjoy supporting their friends and loved ones, organizing social gatherings and doing their best to make sure everyone is happy\",\"Consultant personalities are social creatures, and thrive on staying up to date with what their friends are doing\"]',        '1',    '2019-02-06 13:31:05',  '2019-02-07 13:31:05'),
(12,    '1,2,3',    '3,2,1',    '2',    '[\"Diplomats looking for the hint of good in even the worst of people and events, searching for ways to make things better\",\"Diplomats qualities enable INFPs to communicate deeply with others, easily speaking in metaphors and parables, and understanding and creating symbols to share their ideas\",\"Diplomats have a talent for self-expression, revealing their beauty and their secrets through metaphors and fictional characters\",\"Diplomats communication also lends itself well to INFPs desire for harmony, a recurring theme with Diplomats, and helps them to move forward as they find their calling\"]',   '1',    '2019-02-06 13:31:10',  '2019-02-07 13:33:52'),
(13,    '1,2,3',    '4,1,1',    '2',    '[\"Executive are representatives of tradition and order, utilizing their understanding of what is right, wrong and socially acceptable to bring families and communities together\",\"Executive personalities lead by example, demonstrating dedication and purposeful honesty, and an utter rejection of laziness and cheating, especially in work\",\"Executive declares hard, manual work to be an excellent way to build character\",\"Executive aware of their surroundings and live in a world of clear, verifiable facts  the surety of their knowledge means that even against heavy resistance, they stick to their principles and push an unclouded vision of what is and is not acceptable\"]',    '1',    '2019-02-06 13:31:15',  '2019-02-07 13:36:17'),
(14,    '1,2,3',    '1,5,9',    '5',    '[\"Architect lonely at the top, and being one of the rarest and most strategically capable personality types.\",\"Architect form just two percent of the population, and women of this personality type are especially rare, forming just 0.8% of the population.\",\"Architect enjoy sharing what they know as well, confident in their mastery of their chosen subjects.\",\"Architect at times it will seem that architect are bent on deconstructing and rebuilding every idea and system they come into contact with, employing a sense of perfectionism and even morality to this work.\"]', '1',    '2019-02-07 12:59:25',  '2019-02-07 13:37:57'),
(15,    '1,2,3',    '1,10,10',  '7',    '[\"Good Job\"]',   '1',    '2019-02-08 10:34:50',  '2019-02-08 10:34:50');
